package org.springframework.samples.petclinic.vet;

import org.junit.jupiter.api.Test;
import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.DisplayName;
import static org.junit.jupiter.api.Assertions.*;
import org.junit.jupiter.api.extension.ExtendWith;
import org.mockito.InjectMocks;
import org.mockito.Mock;
import org.mockito.junit.jupiter.MockitoExtension;
import static org.mockito.Mockito.*;
import java.util.Arrays;
import java.util.Collections;
import org.springframework.data.domain.Page;
import org.springframework.data.domain.PageRequest;
import org.springframework.data.domain.Pageable;
import java.util.List;
import org.springframework.ui.Model;

@ExtendWith(MockitoExtension.class)
class VetControllerTest {

	@Mock
	private VetRepository vetRepository;

	@InjectMocks
	private VetController controller;

	@BeforeEach
	void setUp() {
		// Mockito initializes @Mock and @InjectMocks automatically
	}

	@Test
	@DisplayName("Returns vet list view with paginated vets and model attributes set correctly when page has vets")
	void testShowVetListWithValidPage() {
		Vet vet1 = new Vet();
		vet1.setId(1);
		Vet vet2 = new Vet();
		vet2.setId(2);
		List<Vet> vetList = Arrays.asList(vet1, vet2);
		Page<Vet> paginated = mock(Page.class);
		when(paginated.toList()).thenReturn(vetList);
		when(paginated.getContent()).thenReturn(vetList);
		when(paginated.getTotalPages()).thenReturn(3);
		when(paginated.getTotalElements()).thenReturn(6L);
		Pageable pageable = PageRequest.of(0, 5);
		when(vetRepository.findAll(pageable)).thenReturn(paginated);
		Model model = mock(Model.class);
		var result = controller.showVetList(1, model);
		assertNotNull(result);
	}

	@Test
	@DisplayName("Returns vet list view with empty vet list and correct model attributes when page has no vets")
	void testShowVetListWithEmptyPage() {
		List<Vet> emptyList = Collections.emptyList();
		Page<Vet> paginated = mock(Page.class);
		when(paginated.toList()).thenReturn(emptyList);
		when(paginated.getContent()).thenReturn(emptyList);
		when(paginated.getTotalPages()).thenReturn(1);
		when(paginated.getTotalElements()).thenReturn(2L);
		Pageable pageable = PageRequest.of(1, 5);
		when(vetRepository.findAll(pageable)).thenReturn(paginated);
		Model model = mock(Model.class);
		var result = controller.showVetList(2, model);
		assertNotNull(result);
	}

}
